import { Link,Outlet,useNavigate } from "react-router-dom";
import { Container, Row, Col } from "react-bootstrap";
import Classess from '../../css/index.module.css'
export default function Footer() {
   const navigate = useNavigate();
  return (
      <Container fluid className="bg-dark py-2 ">
        <Row>
          <Col
            onClick={() => navigate(-1)}
            className={`${Classess.link} ${Classess.hover} text-end  py-1 rounded-pill border border-warning`}
          >
            GO BACK
          </Col>
           <Col
            onClick={() => navigate(1)}
            className={`${Classess.link} ${Classess.hover} text-start px-4 py-1 rounded-pill border border-warning`}
          >
            GO FORWARD
          </Col>
          <Col
            onClick={() => navigate(1)}
            className={`${Classess.link} ${Classess.hover} text-start px-4 py-1 rounded-pill border border-warning`}
          >
            GO FORWARD
          </Col>
        </Row>
      </Container>



    );
}
